import React from 'react';
import '../Header/header.css';
import BusLogo from '../../assets/icon/bus.svg';
function Store() {
    return (
     <nav className='Nav'>
        <div className='leftNav'>
        <img src={bus} alt="BusLogo"></img>
        <h3>BusDelivery</h3>
      </div>
        </nav>
    )
}
export default Store;
